};

//============================================================
// L2DMatrix44 # transformX()
//============================================================
L2DMatrix44.prototype.transformX = function (src /*float*/) {
 return this.tr[0] * src + this.tr[12];
};

//============================================================
// L2DMatrix44 # transformY()
//============================================================
L2DMatrix44.prototype.transformY = function (src /*float*/) {
